import "./App.css";

import { BrowserRouter, Route, Switch } from "react-router-dom";

import Login from "./Components/Login";
import Login2 from "./Components/Login2";
import React from "react";

function App() {
  return (
    <BrowserRouter>
      <h1>HOLAhola</h1>
      <div className="App">
        <Switch>
          <Route exact path="/login">
            <Login />
          </Route>
          <Route exact path="/login2">
            <Login2 />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
